import React, {Component} from "react";
import {Link} from "react-router-dom";

class Story extends Component {
    render(){
        const {title, story, url} = this.props

        return(
            <div className="story">
                <Link to={url}></Link>
                <h2>{title}</h2>
                <p>{story}</p>
            </div>
        );
    }
}

export default Story;
